import './MyClipBoard.css';
export const MyClipBoard = () => {
    return (
        <div className="clip-board">
            <fieldset className="text_field-email">Ваша електронна пошта</fieldset>
            <fieldset className="text_field-name">Ваше ім'я</fieldset>
            <fieldset className="text_field-comment">Коментарій або покликання</fieldset>
            <fieldset className="selector-false-language">Мова</fieldset>
        </div>
    )
}
